import React, { Component } from 'react';
import InputBox from './InputBox';

export default class NewAccount extends Component {
    state = {  } 

    render() { 
        return (
            <div>
                <h2>Create a New Account</h2>

                <InputBox labelName={"First Name"}/>
                <InputBox labelName={"Last Name"}/>
                <InputBox labelName={"Address"}/>
                <InputBox labelName={"City"}/>
                <InputBox labelName={"State"}/>
                <InputBox labelName={"Zip Code"}/>
                <InputBox labelName={"Phone Number"}/>
                
                <h3>Are you a Pilot or a Passenger?</h3>
                <button>I am a Pilot</button><br></br>
                <button>I am a Passenger</button><br></br><h2></h2>
                <button>Submit</button>
            </div>
        );
    }
}
